import img from './doc.jpg';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col'; 
import Container from 'react-bootstrap/Container';
import { AiOutlineInstagram , AiOutlineFacebook, AiFillTwitterCircle, AiFillLinkedin} from "react-icons/ai";      


function Home1() {
  return (
     <div>
    <Container>

        <Col style={{}}>
            <Row>

            <img src={img}  width="300" height="300"  style={{verticalAlign:"top", position:"center", marginTop:"100px"}}/>
            </Row>
            <Row>
                {/* <Typography variant="h3"  gutterBottom style={{fontFamily: 'Roboto Slab'}}> */}
                    DR. BHARATH KUMAR B

                {/* </Typography>
                <Typography variant="h5"  gutterBottom style={{fontFamily: 'Roboto Slab'}}> */}
                    <i>MBBS, PGDSM (Sports Medicine)</i>
                {/* </Typography> */}
            </Row>
            <br/>
            <Row>
            <AiOutlineInstagram size="40"/>
            <AiOutlineFacebook size="40"/>
            <AiFillTwitterCircle size="40"/>
            <AiFillLinkedin size="40"/>

            </Row>
        </Col>

        <hr/>



    </Container>  

        <div className="row col-sm-12">
            <div className="col-sm-6">
                {/* <Typography variant="h6" style={{fontFamily: 'Roboto Slab', margin:"20px"}}> */}
                    Dr. Bharath Kumar B is an Allopathic Doctor specialized in Sports Medicine from the prestigious 
                    Netaji Subhas National Institute of Sports. He practices Sports Medicine, Exercise Medicine, and 
                    Nutritional Medicine. He has completed professional training in Low Carbohydrate High Fat/Ketogenic Nutrition 
                    & Treatment from Nutrition Network.
                    He is the Founder, Director of Kinesis Sports Clinic, which offers Sports Medicine and Sports Nutrition services
                    to athletes. He is also the Creator & Program Director of MediFit, an online Medical Weight Loss program.
                {/* </Typography> */}
            </div>

            <div className="col-sm-6">
                {/* <Typography variant="h6" style={{fontFamily: 'Roboto Slab', margin:"20px"}}> */}
                    My mission is to help the athletes to win Gold medals at the Olympics. He strives to create a Fit India through 
                    Nutrition, Exercise, and Lifestyle. He envisions a world free from lifestyle disorders!
                {/* </Typography> */}
            </div>
        </div>




    </div>
  );
}

export default Home1;
